    def findMaxAverage2(self, nums: List[int], k: int) -> float:
        l = 1
        currSum = sum(nums[:k])
        # print(nums[:k])
        # print(currSum)
        maxAvg = sum(nums[:k]) / k
        # print(maxAvg)
        # print("-----~~~~------")
        print("From {} to {}".format(l+k,len(nums)))
        for n in range(l + k, len(nums) + 1):
            print("l: {}".format(l))
            print(nums[l])
            print("k: {}".format(k))
            print("n: {}".format(n))
            print(nums[n-1])
            print(nums[l:n])

            print(currSum + nums[n-1] - nums[l-1])
            currSum = currSum + nums[n-1] - nums[l-1]
            print(currSum / k)
            avg = currSum / k
            if avg > maxAvg:
                maxAvg = avg
            
            l += 1

        return maxAvg


